import { defineMessages } from 'react-intl';

export const scope = 'app.containers.EmployeeAddition';

export default defineMessages({
  employeeDashboard: {
    id: `${scope}.employeeDashboard`,
    defaultMessage: 'Employee Dashboard',
  },
  employeeAddition: {
    id: `${scope}.employeeAddition`,
    defaultMessage: 'Employee Addition',
  },
  networkErrorTitle: {
    id: `${scope}.networkErrorTitle`,
    defaultMessage: 'No internet connection!',
  },
  networkErrorMessage: {
    id: `${scope}.networkErrorMessage`,
    defaultMessage: 'No internet connection!',
  },
  serverErrorMessage: {
    id: `${scope}.serverErrorMessage`,
    defaultMessage: '500 Something went wrong!',
  },
  serverErrorTitle: {
    id: `${scope}.serverErrorTitle`,
    defaultMessage: '500 Something went wrong!',
  },
  employeeRole: {
    id: `${scope}.employeeRole`,
    defaultMessage: 'Employee Roles',
  }

});
